import {useNavigate} from "react-router-dom";

const LoginButton = () => {
    const navigate = useNavigate();

    const routeToLoginPage = () => {
        let path = '/login';
        navigate(path);
    }

    return (
        <div>
            <button type={"submit"} onClick={routeToLoginPage}>Login</button>
        </div>
    )
}

export default LoginButton;
